import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <Header/>
        <Technoligies/>
      i will be a react developer!!!
    </div>
  );
}

const Header = () => {
    return (
        <div>
            <a>Home</a>
            <a>News Page</a>
            <a>Messages</a>
        </div>
    );
}

const Technoligies = () => {
    return (
        <div>
            i need to learn
            <ul>
                <li>CSS</li>
                <li>HTML5</li>
                <li>JS</li>
                <li>React</li>
            </ul>
        </div>
    )
}

export default App;
